description:
In the aristocratic Oddy-Pittman home, nothing is quite normal. Lanny, for one, is the daughter of the family chauffeur, who's been in love with Tony Oddy-Pittman for as long as she can remember. And since she's totally beautiful and completely hot, Tony is very much in love back and never forgets it for a minute. But on the way to a finest finishing school in France, Lanny discovers something about Tony that not even Paris can make her forget.
Paul Thomas adult's most awarded director, brings you a &quot;dramadey&quot; on two continents, starring the most amazing girl on either ...Lanny... in five incredible scenes! Paul Thomas' Chauffeur's Daughter... a new classic is born.

Lanny Barby, Paulina James, Victoria Valentino, Ava Lauren, Kelly Wells, Kimberly Franklin, Hershel Savage, Jay Ashley, Manuel Ferrara, Kurt Lockwood, James Deen

